import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, InputBase, Typography, Grid } from '@mui/material'; // Import from '@mui/material'
import SearchIcon from '@mui/icons-material/Search'; // Import from '@mui/icons-material'
import axios from 'axios';

const apiUrl = 'https://mocki.io/v1/ddb7e0a8-e218-4e36-b1be-b902cdb1c098';

const UserDetails = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get(apiUrl)
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.error('Error fetching user details:', error);
      });
  }, []);

  return (
    <div>
      <AppBar position="static" sx={{ bgcolor: '#2196F3' }}> {/* Use 'sx' for styles */}
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}> {/* Use 'sx' for styles */}
            User Details
          </Typography>
          <div style={{ position: 'relative' }}>
            <div style={{ position: 'absolute', display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100%' }}>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
              sx={{ pl: 6 }} // Use 'sx' for styles
            />
          </div>
        </Toolbar>
      </AppBar>
      <Grid container spacing={2} marginTop={2}> {/* Use 'marginTop' prop */}
        {users.map(user => (
          <Grid item xs={12} key={user.id}>
            {/* <ProfileCard user={user} /> */}
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default UserDetails;
